import React from 'react';
import styles from './App.module.css';

const whoWeAreSlider = {
  slide1: "Pikachu",
  slide2: "Squirtle",
  slide3: "Charmander",
  slide4: "Bulbasaur",
};

const images = {
  image1: "data:image/png;base64,",
  image2: "data:image/jpeg;base64,",
  image3: "data:image/jpeg;base64,",
  image4: "data:image/jpeg;base64,",
}

const App = () => {
  return (<>
    <section className={styles.slider}>
      <div className={styles.slider__wrapper}>
        {Object.values(whoWeAreSlider).map((slide, i) => (
          <figure key={`slide_${i + 1}`} className={styles.slider__figure}>
            <img src={images[`image${ i + 1 }`]} alt={slide} />
            <b>{ slide }</b>
          </figure>
        ))}
      </div>
    </section>
  </>);
};

export default App;